import { a } from "react-router-dom"
export default function Nav(){
    return(
       <header className="header">
        <a to={'/'} className="logo">MoviesInfo</a>
        <nav className="navbar">
          <a className="a" to={'/'}>Movie</a>
          <a className="a" to={'/serie'}>Series</a>
          <a className="a" to={'/search'}>Search</a>
        </nav>
       </header>
    )
}
